public class TuyaAction {
	private String tool;
	private String color;
	private int size;
	private List<TuyaEvent> events;
	
	public String getTool() {
		return tool;
	}
	public void setTool(String tool) {
		this.tool = tool;
	}
	public String getColor() {
		return color;
	}
	public void setColor(String color) {
		this.color = color;
	}
	public int getSize() {
		return size;
	}
	public void setSize(int size) {
		this.size = size;
	}
	public List<TuyaEvent> getEvents() {
		return events;
	}
	public void setEvents(List<TuyaEvent> events) {
		this.events = events;
	}

}
